import React from 'react'
import { Link } from 'react-router-dom'

export function UsersModal({ users }) {

    const changeProfile = () => {
        console.log('users is:', users);
    }

    return (
        <div className="user-modal">
            <div className="flex col users-list-modal">
                {users?.map(user => {
                    return <div
                        key={user._id}
                        className="user flex align-center" >
                        <img className="img-users" src={user.color} alt="user-img" />
                        <Link className="user-name"
                            to="/user"
                            onClick={changeProfile}>
                            {user.name}
                        </Link>
                    </div>
                })}
            </div>
            <div className="bottom flex col">
                <Link>Account</Link>
                <Link>Help</Link>
                <Link>Logout from Netflix</Link>
            </div>
        </div>
    )
}
